BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "obras_obra" (
	"id"	integer NOT NULL,
	"col_comunidad"	varchar(200) NOT NULL,
	"rubro"	varchar(60) NOT NULL,
	"subclasificacion"	varchar(40) NOT NULL,
	"nombre_obra"	varchar(200) NOT NULL,
	"tenencia"	varchar(30) NOT NULL,
	"modalidad_ejecucion"	varchar(17) NOT NULL,
	"metas_cantidad"	integer unsigned NOT NULL CHECK("metas_cantidad" >= 0),
	"metas_unidad"	varchar(10) NOT NULL,
	"metas_beneficiarios"	integer unsigned NOT NULL CHECK("metas_beneficiarios" >= 0),
	"costo_total"	real NOT NULL,
	"inv_estatal"	real NOT NULL,
	"fism"	real NOT NULL,
	"inv_federal"	real NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
